    QUALIFY ROW_NUMBER() OVER(
        PARTITION BY {{ automate_dv.prefix([src_pk], 'ru') }}
        ORDER BY {{ automate_dv.prefix([src_ldts], 'ru') }}, {{ automate_dv.prefix([src_source], 'ru') }} ASC
